import React from "react";

export const PetPicker = ({ data }) => {
  // Check if data is undefined or null
  if (!data) {
    return null; // or any fallback UI
  }

  return (
    <select>
      {data.map((item) => (
        <option key={item.id} value={item.id}>
          {item.name}
        </option>
      ))}
    </select>
  );
};
